import React from 'react';
import { Grid, Paper } from '@material-ui/core';

export default props => {
  return (
    <Grid container spacing={16}>
      <Grid item xs>
        <Grid container justify="center" spacing={Number(spacing)}>
            {[0, 1, 2].map(value => (
              <Grid key={value} item>
                <Paper/>
              </Grid>
            ))}
        </Grid>
      </Grid>
    </Grid>
  );
}
